void mainImage( out vec4 f, in vec2 w )
{
	vec2 r = iResolution.xy, p = w - r*.5;
	float d = length(p) / r.y , a = atan(p.x, p.y)/6.283,
    e = pow(d,.15), v = .3/mod(floor((e+.15)*10.), 6.),
    c = abs(mod(a + iDate.w*v*v*8. - d, .1)/.02 - 2.) * abs(mod(e, .1)/.1 - .5); d+=.2;
	f = vec4(c,c*d*d,c-d,1)*(d+.5);
}
